import React from "react";
import Wave from "../components/Wave/Wave";

function About() {
  return (
    <>
      <Wave />
      <main className="about">
        <h2>&#57672; - Biography</h2>
      </main>
      <Wave flipped={true} />
    </>
  );
}

export default About;
